const App = () => {

return (
  <div>
<NavbarComponent/>
<Routes>
<Route path="/view/:id" element={<ViewbyId/>} />

<Route path="/allstud" element={<Home/>} />
<Route path="/addstud" element={<AddUser />}/>
<Route path="/" element={<About />} />
<Route path="/edit/:id" element={<EditUser/>}/>
</Routes>
{/* <Home/>
<AddUser/> */}
  </div>

  );
};
export default App;
